import './App.css';
import './MemberOverview'
import { MenuBar } from './MenuBar';
import { MemberOverview } from './MemberOverview';
import { ChakraProvider } from '@chakra-ui/react'

function App() {
  return (
    <ChakraProvider>
      <div className="App">
        <header className="App-header">
          <MenuBar />
          <MemberOverview />
        </header>
      </div> </ChakraProvider>

  );
}

export default App;
